import React from 'react';
import "./NavigationTable.css";

export default function NavigationTable({id,className,links}) {
    return (
        <div>
        <div id={id} className={className}>
            {links.map((link,index) =>
                <a>{link}</a>
            )}
        </div>
        </div>
    )
}
